    state = {
        curent:'USD'
    }

    render(){

        return(
            <div>
                Prices
                <ul>
                    <li>Bitcoin Rate For </li>
                    <ul>
                        {props.shows.map(({ show }) => (
                            <li key={show.id}>
                                <Link as={`/p/${show.id}`} href={`/post?id=${show.id}`}>
                                    <a>{show.name}</a>
                                </Link>
                            </li>
                        ))}
                    </ul>
                </ul>
            </div>
        )
    }



}


export default Prices;
